// src/App.js
import React from 'react';
import { Routes, Route } from 'react-router-dom';
import SpinPage from './pages/SpinPage';
import Home from './pages/Home';

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/spin" element={<SpinPage />} />
    </Routes>
  );
}

export default App;
